import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TagForm = () => {
  const [tags, setTags] = useState([]);

  useEffect(() => {
    // Obtém as tags do servidor Node.js
    axios.get('http://localhost:8082/rota') // Substitua pela URL do seu servidor
      .then(response => setTags(response.data.tags))
      .catch(error => console.error('Erro ao obter tags:', error));
  }, []);

  return (
    <div>
      <h2>Lista de Tags RFID</h2>
      <ul>
        {tags.map(tag => (
          <li key={tag}>{tag}</li>
        ))}
      </ul>
    </div>
  );
};

export default TagForm;
